(function() {
    console.log("Iniciando player BTS...");
    
    // --- CONFIGURAO ---
    // Coloque o nome EXATO do arquivo que voc jogou na pasta assets
    // Se voc no baixou, o link abaixo  um "instrumental estilo K-pop" provisrio que funciona:
    // var urlAudio = "https://cdn.pixabay.com/download/audio/2022/03/10/audio_c8c8a73467.mp3"; 
    
    // Se voc j colocou o arquivo 'bts.mp3' na pasta assets, use esta linha:
    var urlAudio = "./assets/bts.mp3";
    
    var audio = new Audio(urlAudio);
    
    audio.loop = true;  // Repetir a msica quando acabar
    audio.volume = 0.2; // VOLUME: 0.2  20% (Bem suave). Se quiser mais alto, mude para 0.4
    // --------------------

    var promessa = audio.play();

    if (promessa !== undefined) {
        promessa.catch(function(error) {
            console.log("Autoplay bloqueado. Aguardando clique.");
            // Toca no primeiro clique
            document.body.addEventListener('click', function() {
                audio.play();
            }, { once: true });
        });
    }
})();
